NV = size(vertices,1);% 頂点数
angles = zeros(NV,2);% 各頂点を球面座標変換したときの経度と緯度
for iv = 1:NV
    % 直交座標から球面座標へ
    [azimuth,elevation] = ...
        cart2sph(vertices(iv, 1), vertices(iv, 2), vertices(iv, 3));
    angles(iv, 1) = azimuth;% 経度を度数に変換
    angles(iv, 2) = elevation;% 緯度を度数に変換
end
disp(strcat(num2str(NV),'個の視点から投影を計算'));

%% 大きな空間へモデルを格納
Interpolation = 'nearest';% 補間方法を選択
disp(strcat(Interpolation,'で補間中...'));

[NX,NY,NZ] = size(Model);
% モデルがある空間全体を投影画像上に収めるために必要な新しい空間の大きさ
NX2 = ceil(sqrt(3)*NX);NY2 = ceil(sqrt(3)*NY);NZ2 = ceil(sqrt(3)*NZ);
NewSpace = zeros(NX2, NY2, NZ2);
% 新しい空間の中心にモデルを格納
CX = floor((NX+1)/2); CY = floor((NY+1)/2); CZ = floor((NZ+1)/2);% モデルが格納されている空間の中心
CX2 = floor((NX2+1)/2); CY2 = floor((NY2+1)/2); CZ2 = floor((NZ2+1)/2);% 新しい空間の中心
xmin = CX2-(CX-1); xmax = CX2+(NX-CX);
ymin = CY2-(CY-1); ymax = CY2+(NY-CY);
zmin = CZ2-(CZ-1); zmax = CZ2+(NZ-CZ);
NewSpace(xmin:xmax,ymin:ymax,zmin:zmax) = Model;% 新しい空間にモデルを格納

%% 姿勢変化を利用した投影
Proj = zeros(NY2, NZ2, NV);
for ia = 1:NV
    azimuth_ia = angles(ia, 1);% 経度
    elevation_ia = angles(ia, 2);% 緯度
    ModelRotated = rot3d(NewSpace, -1*elevation_ia, -1*azimuth_ia, Interpolation);% 姿勢変化
    Proj(:,:,ia) = squeeze(sum(ModelRotated,1));% X方向に線積分（投影）
end